PRAGMA journal_mode = off;
PRAGMA cache_size = -1024000;

DROP TABLE IF EXISTS "composite_images";
DROP TABLE IF EXISTS "index_images";
DROP TABLE IF EXISTS "normalized_images";
DROP TABLE IF EXISTS "spectral_bands";
DROP TABLE IF EXISTS "sensors";
DROP TABLE IF EXISTS "wrs";

-------------------------------------------------------------------------------------------
--------------------------------- "Let there be light" ------------------------------------
-------------------------------------------------------------------------------------------

CREATE TABLE "sensors" (
	"id" TEXT PRIMARY KEY,
	"sensor" TEXT,
	"full_name" TEXT,
	"satellite" TEXT,
	"temporal_resolution" REAL
);

CREATE TABLE "spectral_bands"(
	"sensor_id" TEXT,
	"band_number" TEXT,
	"band_name" TEXT,
	"mm_start_interval" REAL,
	"mm_central_interval" REAL,
	"mm_end_interval" REAL,
	"nm_bandwith" REAL,
	"spatial_resolution" REAL,
	PRIMARY KEY("sensor_id", "band_number"),
	FOREIGN KEY("sensor_id") REFERENCES sensors(id)
);

CREATE TABLE "normalized_images"(
	"id" INTEGER PRIMARY KEY AUTOINCREMENT,
	"sensor_id" TEXT,
	"band_number" TEXT,
	"reflectance_correction" TEXT,
	"pixel_size" REAL,
	"srid" INTEGER,
	"upper_left" REAL,
	"lower_left" REAL,
	"upper_right" REAL,
	"lower_right" REAL,
	"origin" REAL,
	"nlines" INTEGER,
	"ncolumns" INTEGER,
	"acquisition_year" INTEGER,
	"acquisition_julian_day" INTEGER,
	"acquisition_date" DATE,
	"cloud_cover" REAL,
	"img_filepath" TEXT,
	"cloud_filepath" TEXT,
	FOREIGN KEY("sensor_id","band_number") REFERENCES "spectral_bands"("sensor_id","band_number")
);

CREATE TABLE "index_images"(
	"id" INTEGER PRIMARY KEY AUTOINCREMENT,
	"index_name" TEXT,
	"img_filepath" TEXT
);

CREATE TABLE "composite_images"(
	"id" INTEGER PRIMARY KEY AUTOINCREMENT,
	"composite_name" TEXT,
	"img_filepath" TEXT,
	"quality_img_filepath" TEXT
);

CREATE TABLE "wrs" (
	"id" TEXT,
	"utm_srid" INTEGER REFERENCES spatial_ref_sys(srid)
);
SELECT AddGeometryColumn('wrs','Geometry',4326,'POLYGON','XY');

